import React from 'react'

export default function LogFilter(props) {
    return (
        <div>
            年份: <select value={props.year}>
                <option value="2023">2023</option>
                <option value="2021">2021</option>
                <option value="2023">2023</option>
            </select>
        </div>
    )
}
